import styled from "styled-components";

const CardStyled = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 34em;
  height: 10em;
  margin: 2em;
  border-radius: 10px;
  background-color: #718093;
`;

export default CardStyled;
